import React, { useState, useEffect } from "react";
import axios from "axios";
import {Routes, Route, useNavigate} from 'react-router-dom';
import {getUser, getToken} from './Service/AuthService';

export const Base = () => {

  const navigate = useNavigate();
  useEffect(() => {
    navigate("/login");
  }, []);

  return (
    <div>
      Hello
    </div>
  );
};

export default Base;
